import React from 'react';

import {
   Card, CardMedia, CardContent,
   CardActions, Button, Typography
} from '@mui/material';

import LoremIpsum from 'react-lorem-ipsum';

export default function Resort(props) {

   let [resortData, setResortData] = React.useState({});
   const corsProxy = 'https://mighty-scrubland-75189.herokuapp.com';

   React.useEffect(() => {
      fetch(`${corsProxy}/https://liftie.info/api/resort/${props.resort.query}`)
         .then(response => response.json())
         .then(data => {
            setResortData(data);
            setIsBodyLoading(false);
            console.log(resortData);
         })
         .catch((error) => {
            console.log(`Encountered error in Liftie Fetch request: ${error}`)
         });
   }, [])

   return (
      <>
         <div>You clicked on this ski resort: {props.resort.query}</div>
         {/* <LoremIpsum p={12}></LoremIpsum> */}
      </>
   );

}
